import React from "react";
import axios from "axios";
import { useState } from "react"

const URI = "http://localhost:1337/crearCuenta";

const Register = () => {
    
    const [state, setState] = useState({
        usuario: "",
        password: "",
        nombre: "",
        area: "",
        nulidad: "",
        investigacion: "",
        otros: "",
    });

    const [errorMsg, setErrorMsg] = useState("");

    const handleInputChange = (event) => {
        setState({
            ...state,
            [event.target.name]: event.target.value,
        });
        console.log(state.nombre);
    }

    const handleOnSubmit = async (event) => {
        event.preventDefault();
        try{
            if(state.nombre.trim() !== ''){
                const formData = {nombre:state.nombre, numero:state.numero, expediente:state.expediente, actor:state.actor, estatus:state.estatus, fecha:state.fecha};
                console.log(formData);

                setErrorMsg('');
                await axios.post(URI, formData, {
                    headers: {
                        'Content-Type': 'application/json',
                    }
                });
        } else {
            setErrorMsg("Por favor, ingrese un nombre para el expediente");
        }
    } catch (error) {
        error.response && setErrorMsg(error.response.data);
    }}







    return(
        <body>
            <h1>Registrar Cuenta</h1>
            <form onSubmit={handleOnSubmit}>
                <input type="text" name="nombre" onChange={handleInputChange} value={state.nombre} placeholder="Nombre Completo" required/><br/>
                <input type="text" name="area" onChange={handleInputChange} value={state.area} placeholder="Area" required/><br/>
                <input type="text" name="usuario" onChange={handleInputChange} value={state.usuario} placeholder="Usuario" id="usuario" required/><br/>
                <input type="password" name="password" onChange={handleInputChange} value={state.password} placeholder="ContraseÃ±a" id="password" required/><br/>
               
                <h4>Privilegios:</h4>
                <input type="checkbox" onChange={handleInputChange} value="true"/>Juicio de Nulidad<br/>
                <input type="checkbox" onChange={handleInputChange} value="true"/>Carpeta de Investigacion<br/>
                <input type="checkbox" onChange={handleInputChange} value="true"/>Expedientes Otros<br/>

                <br/>
                <input type="submit" value="Crear Cuenta"/><br/>
            </form>
        </body>
    );
}

export default Register;
